(1, -1, 'Inicio', 213, '1', '1', 1, 0, 0, 'inicio', 'frontpage4', 'catalog_frontpage_headline_shop_IT|', '<i><b><font color=\"#0E668C\" size=\"16\">¡Bienvenid@ al Catálogo de Habbo 100% Actualizado</font></b></i><br><br>El HC Club es gratuito, aprovecha la oportunidad de comprar furnis con créditos totalmente gratis de la manera que más te guste. Explora y crea salas geniales para que tu experiencia sea mucho mejor. ¡Navega por nuestra tienda.<br><br><li>Ír a la <a href=\"event:catalog/open/habbo_club\"> Tienda HC</a></li><li><a href=\"event:catalog/open/set_pixelnew\"> Decora </a>tus Salas</li><li> Adopta<a href=\"event:catalog/open/Tienda de mascotas\"> una Mascota</a> o un <a href=\"event:catalog/open/bots\">BOT</a></li><li>Crea salas con<a href=\"event:catalog/open/category_wired\"> Wired</a></li><li>Cotiza en el <a href=\"event:catalog/open/marketplace_offers\"> Mercadillo</a></li><br><i><b><font color=\"#0E668C\" size=\"16\">Ã‚Â¿DÃƒÂ³nde puedo obtener Diamantes?</font></b></i><br><br>Tenemos un par de mÃƒÂ©todos de pago como tarjetas de crÃƒÂ©dito y PayPal que le permiten comprar créditos en nuestra tienda web.<br><br><a href=\"https://easybuy.pw/packages/currency\" target=\"_new\">Visita nuestra página de divisas para obtener mÃƒÂ¡s informaciÃƒÂ³n.</a>|CANJEA TU CÓDIGO AQUI:'),
(3, 0, 'Furnis', 2, '0', '1', 0, 0, 1, 'furnis_habbo', 'default_3x3', '|', 'Acá encontrarás gran variedad de FURNIS, caracterizado por varias secciones a tu gusto y bien organizado.|'),
(4, 1004, 'Rares', 215, '1', '1', 1, 0, 2, 'premios', 'pets3', '|', 'Para estos carnavles la Sección Premios lucirá diferente con grandes premios & Sorpresas para nuestros usuarios. Adquiere con tu moneda.|<font color=\"#0098CB\"><b>¡Premios!</b></font>|La sección Premios gracias a <font color=\"#0098CB\"><b>Carnaval</b></font> luce diferente. Aca podrás adquirir tus raros con tu <b> Moneda Especial</b>, y gracias a este mes de Enero, febrero habrá precios bastante bajos para todos, incluyendo raros que parecerán gratuitos. ¡Estate pendiente de las Actualizaciones\r\n\r\n<b>¿No tienes ni Estrellas, ni duckets, ni diamantes?</b>. No te preocupes, gracias a los constantes eventos que se abren en el hotel podrás ganar alguna moneda y adquirir tus raros.|'),
(6, 6776, 'Eventos Staffs', 28, '1', '1', 1, 0, 30, '', 'default_3x3', 'vipheader1|vipteaser2', 'ESTOS RARES que verÃƒÂ¡s a continuaciÃƒÂ³n, son los RARES que darÃƒÂ¡s en Concursos. Ver el CatÃƒÂ¡logo Oficial de HPlux para ver los precios de cada uno. Ã‚Â¡Suerte GM!.'),
(8, 699, 'Regalos HC', 214, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_header_hc|hc_catalog_teaser', 'Hey hey.. acá encontrarás los Furnis MasterCMSlub... ¡Pero tranquilos! en Habbo el HC es totalmente gratuito.|'),
(9, 1004, 'Bots', 65, '1', '1', 1, 0, 8, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', '¡Compra tu Propio Bot, Pueden hablar, caminar y darle estilo a cualquier sala!|Nota: los Bots los puedes personalizar una ves los tenga en tus salas.!'),
(10, 1004, 'Mercadillo', 69, '1', '1', 1, 0, 12, 'mercal_1', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'Vende los furnis que no estes ulizando a un precio razonable.|¿No te funciona el mercadillo?|Vendiendo Furnis: Debes vender algun furni que no necesites y que tengas en el inventario y ponerle un precio razonable para su venta.\r\n\r\nComprando Furnis: Simplemente ver el furni cual deseas comprar y revisar si es conveniente o no y comprarlo, fácil y sencillo. ¡RUEBALO!.|'),
