(24256, 9036, 'Chat de Grupos', 207, '1', '1', 1, 0, 3, 'chat', 'guild_forum', '|', 'Chat de Grupos|<h2><b><font size=\"16\" color=\"#0F4156\">Chatea con tu grupo</font></h2></b><br><br>Compra un chat de grupo e inicia una conversación con los miembros del Grupo. ¡Así es!|'),
(33333, 9220, 'Furnis exóticos', 963, '1', '1', 1, 0, 2, 'exoticos', 'default_3x3', 'catalog_teaser_AI1_en|catalog_teaser_AI1_en', 'Furnis exóticos 2017 para los fanáticos del arte natural. ¡Adquiere el tuyo!|'),
(50675, 9021, 'Battle Ball', 6900, '1', '1', 1, 0, 1, '', 'default_3x3', '', 'Los Furnis BattleBall han llegado a MasterCMS. Disfruta de ésta gama de Furnis, decora tu sala, y ¡Diviértete!.|'),
