(56070, 9021, 'Habbo Jungla', 59, '1', '1', 1, 0, 2, '', 'default_3x3', '', 'Adéntrate en mundo virtual de supervivencia, terreno traicionero y extremas condiciones tropicales... ¡los furnis MasterCMS Jungla!'),
(56071, 6448, 'JetSet 2016', 265, '1', '1', 1, 0, 9, 'jetset_habbo', 'default_3x3', '', 'Vive la vida a tope con nuestra gama de Furnis Jet Set. Es la gama de furnis para aquellos Fanceros. a los que les encanta organizar fiestas de extravagante tamaño y presumir de su estilo.! '),
(56072, 6448, 'Olimpicos 2016', 266, '1', '1', 1, 0, 8, '', 'default_3x3', '', 'Las olimpiadas de este año han empezado y MasterCMS no se queda atrás, disfruta de esta nueva gama de furnis para que los Fanceros compitan entre sí­. ¡Suerte!!'),
(56077, 91, 'Rainbow', 28, '1', '1', 1, 0, 2, '', 'default_3x3', '', ''),
(56081, 76, 'San Valentín 2016', 144, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Disfruta de los furnis san valentín 2016'),
(56085, 6448, 'Habboween 2016', 269, '1', '1', 1, 0, 4, 'habbo_ween16', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15', 'Al estilo clásico de Habboween, los de este año vienen con un diseño similar a los Habboween de siempre. En donde podrías diseñar una mansión tenebrosa o hasta una casa de vampiros, ¿Tu que crearías?. Por cierto ¡Cuidado!.|'),
(57487, 9220, 'San Valentin 2017', 290, '1', '1', 1, 0, 3, 'novios2017', 'default_3x3', 'novios2017catalog|novios2017catalog', 'Han llegado la nueva gama de furnis San Valentin 2017 a MasterCMS. ¿Estarás solo? ¡Búscate a alguien pinche fe@!'),
(57895, 14, 'Caballos', 132, '1', '1', 1, 0, 4, '', 'pets', 'catalog_horse_header2_en| ', '|'),
(99991, 9021, 'Habburger ', 267, '1', '1', 1, 0, 3, '', 'default_3x3', '', 'Bienvenido al Burguer 2016, quieres comer algo, espero que tengas un gran apetito.\r\nEstos furnis llegaron a HFancy para los usuarios que quieren tener un buen restaurante de 5 estrellas y piensen en grande.'),
(181818, 301, 'Series', 26, '1', '1', 1, 0, 0, '', 'pets3', 'catalog_marketplace_header_en|ctlg_recycler_info', 'Información acerca del Wired, su uso y qué se hace con ellos.|¿Qué es el Wired?|Son furnis de programación visual que te permite realizar salas automáticas, eventos concursos y muchísimas cosas más.\r\n\r\nUtiliza estos furnis Wired con conocimientos previos, son complicados de usar al principio, pero con práctica aprenderás rápidamente.|'),
(202020, 4, 'Raros costo: Duckets', 178, '0', '1', 1, 0, 3, 'costo_duckets', 'default_3x3', 'header_duckets|header_duckets', 'Adquiere tus raros con la moneda Duckets, tranquilo los duckets los obtendrás cada 15 minutos online.|'),
(212121, 4, 'Raros costo: Estrella', 195, '0', '1', 1, 0, 4, 'costo_stars', 'default_3x3', 'header_stars|header_stars', 'Obtén tus rares especiales con la moneda estrella, ¿Cómo se consigue?, participa en concursos y gana.|'),
(213124, 301, 'Clasificaciones', 256, '1', '1', 1, 0, 5, '', 'default_3x3', '|', 'El Máximas Puntuaciones permite hacer un seguimiento de los puntos conseguidos en tus juegos y mostrarlos en tus Salas.'),
(232324, 6776, 'Wired Staff', 464, '1', '1', 6, 0, 6, '', 'default_3x3', '', ''),
(262626, 6448, 'Navidad 2016', 168, '1', '1', 1, 0, 2, 'navidad2016', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'El espíritu de la navidad a llegado a MasterCMS, disfruta de ésta nueva gama de furnis que traemos para ti. ¡Pídele algo a santa y a su reno!|'),
(272727, 9021, 'Café futurista', 267, '1', '1', 1, 0, 5, '|', 'default_3x3', '|', 'En esta categorías podrás disfrutar de la nueva gama Café futurista. ¿se acerca la navidad no crees? ¡Hace falta algo caliente!|'),
(303030, 9021, 'Clásicos 2016', 15, '1', '1', 1, 0, 10, '', 'default_3x3', '|', 'Llegan los furnis clásicos a MasterCMS Hotel ¡Disfruta de ésta gama!'),
(536214, 9036, 'Foro de Grupos', 207, '1', '1', 1, 0, 2, '', 'guild_forum', '¡Los Foros de Grupos ya están aquí|', '¡Los Foros de Grupos ya están aquí!|<h2><b><font size=\"16\" color=\"#0F4156\">¿Qué es un foro de grupo?</font></h2></b><br><br>Los foros te permiten publicar, comentar y discutir temas libremente, ¡y sin tener que dejar el Hotel!<br><br><h2><b><font size=\"16\" color=\"#0F4156\">¿Quién puede activar un foro?</font></h2></b><br><br>Solo el dueño de un grupo puede activar un foro.<br><br><h2><b><font size=\"16\" color=\"#0F4156\">¿Necesito un Panel de Foro?</font></h2></b><br><br>Si. Para poder empezar un Foro de Grupo el dueño tiene que comprar el Panel de Foro.<br><br>Próximamente iremos añadiendo nuevas funcionalidades a esta herramienta.'),
