INSERT INTO `moderation_preset_action_messages` (`id`, `parent_id`, `caption`, `message_text`, `mute_hours`, `ban_hours`, `ip_ban_hours`, `trade_lock_days`, `notice`) VALUES
(1, 1, 'CFH Abuse', 'No abuses del Sistema De Ayuda (SDH), solo debe ser usado en casos de emergencias.', 0, 0, 0, 0, ''),
(2, 1, 'Advertising', 'No publicites otros habbo servidores; Publicar enlaces de otros hoteles, o simplemente mencionar sus nombres de forma deliberada esta extrictamente prohibido y se castiga con baneo de direccion IP.', 0, 0, 0, 0, ''),
(3, 1, 'Scamming', 'Do not attempt to or scam credits or furniture from other users through betting, gaming, or trading.', 0, 0, 0, 0, ''),
(4, 1, 'Bullying', 'Do not bully, harass, or abuse other users; avoid violent or aggressive behaviour.', 0, 0, 0, 0, ''),
(5, 4, 'Personal Info', 'Do not disclose any personal information of another user (e.g., address, IP Address, phone number, school) without their consent.', 0, 0, 0, 0, ''),
(6, 4, 'Spamming', 'Do not excessively repeat identical or similar statements (spamming).', 0, 0, 0, 0, ''),
(7, 4, 'Sexual/Inappropriate', 'Users are to not participate in any sexual, inappropriate, or generally objective acts towards other users without their prior consent.', 0, 0, 0, 0, ''),
(8, 4, 'DDoS', 'Do not attempt to or successfully harm a userÃ”Ã‡Ã–s home internet connection.', 0, 0, 0, 0, ''),
(9, 2, 'Giveaway/sell/trade account', 'Do not attempt to or give away, sell, or trade your Habboon Hotel account and/or Habboon items for virtual items from another game, accounts from another game, cash, or vice versa without permission from an Administrator.', 0, 0, 0, 0, ''),
(10, 2, 'Offensive usernames', 'Do not create a username with an offensive name that is insulting, racist, harassing, or generally objectionable.', 0, 0, 0, 0, ''),
(11, 2, 'IP ban evading', 'Do not evade an IP Address ban.', 0, 0, 0, 0, ''),
(12, 2, 'Account Sharing', 'Do not share your account with other users.', 0, 0, 0, 0, ''),
(13, 5, 'Threats/Hacks', 'Do not threaten to, attempt to, or hack other users\' accounts', 0, 0, 0, 0, ''),
(14, 5, 'Multiple Accounts', 'Do not create multiple accounts for the purpose of taking an advantage over gaining more in-game currency and/or rares of any kind.', 0, 0, 0, 0, ''),
(15, 3, 'Exploit Abusing', 'Do not attempt to or exploit errors of Habboon Hotel; report it to the Administration immediately.', 0, 0, 0, 0, ''),
(16, 3, 'Chargebacks', 'Do not attempt to or refund your VIP Membership or donation to Habboon Hotel at any given time; all payments are final.', 0, 0, 0, 0, ''),
(17, 6, 'Misleading Info', 'Do not intentionally give wrong or misleading information to staff members in reports about rule violations, complaints, bug reports, or support requests.', 0, 0, 0, 0, ''),
(18, 3, 'False statements', 'Do not make false statements against Habboon Hotel or any other part of its services.', 0, 0, 0, 0, ''),
(19, 3, 'Impersonation', 'Do not pretend to be a representative of Habboon Hotel or claim to have their powers.', 0, 0, 0, 0, ''),
(20, 6, 'Threatening Habboon', 'Do not threaten to, attempt to, or use any scripts or third party software to enter, disrupt, or modify Habboon Hotel.', 0, 0, 0, 0, '');
